import React from 'react';
import VerticalLink from './VerticalLink';
import './VerticalLinkList.css'; // Si deseas estilos específicos para la lista

export default function VerticalLinkList() {
    const socialMediaLinks = [
        { image: 'ruta/a/imagen/linkedin.png', title: 'LinkedIn', url: 'https://www.linkedin.com/in/tu-perfil' },
        { image: 'ruta/a/imagen/github.png', title: 'GitHub', url: 'https://github.com/tu-usuario' },
        { image: 'ruta/a/imagen/twitter.png', title: 'Twitter', url: 'https://twitter.com/tu-usuario' },
    ];
    return (
        <div className="socialMediaLinks">
            {socialMediaLinks.map((link, index) => (
                <a href={link.url} key={index} target="_blank" rel="noopener noreferrer">
                    <VerticalLink image={link.image} title={link.title} />
                </a>
            ))}
        </div>
    );
}
